export async function Patch(){
    var user=JSON.parse(localStorage.getItem("user"))
    fetch(`https://localhost:44317/api/Profil/${user,Felhasznalonev}`, {
        method: "PATCH",
        headers: {
            "Content-Type": "application/json"
        },
        body: JSON.stringify({
            UjJelszo: document.getElementById("passwordupdate").value,
            RegiJelszo: document.getElementById("oldpassword").value,
            Telefonszam: document.getElementById("telefonupdate").value,
            TeljesNev: document.getElementById("fullnameupdate").value,
            TelepulesNev: document.getElementById("telepulesupdate").value
          })
    })
        .then((response) => {
            if (!response.ok) {
                if (response.status === 409) {
                    alert("Ez az e-mail cím már regisztrálva van.")
                }
                else {

                    throw new Error(`HTTP hiba! Státuszkód: ${response.status}`)
                }
            }
            else {
                console.log(response.status)
                alert("Sikeres módosítás!")
            }
            //return response.json()
        })
        .catch((error) => {
            console.error("Hiba történt:", error);
            alert("Server hiba. Kérlek próbáld meg később!");
        })
}
